import React, { Component } from "react";
import "./CardDot.css";
export class CardDot extends Component {
  render() {
    return <div className = "container">
      <div className = "col-md-1">
          <span class="dot" />
          <span class="dot" />
          <span class="dot" />
          <span class="dot" />
        </div>
      </div>;
  }
}

export default CardDot;
